import React from "react";
import { useDispatch } from "react-redux";
import { logMessage } from "../store/featureReducer";

const Button = ({ text, color }) => {
  const dispatch = useDispatch();

  const handleClick = () => {
    dispatch(logMessage());
  };

  return (
    <button
      className={`${color} hover:bg-green-600 text-white font-semibold py-2 px-4 rounded`}
      onClick={handleClick}
    >
      {text}
    </button>
  );
};

export default Button;
